'use strict';

var _parse_interval = require('./utils/parse_interval');

var _modules = require('./modules');

var _least_common_interval = require('./vis/lib/least_common_interval');

_modules.uiModules.get('kibana').directive('validateDateInterval', function () {
  return {
    restrict: 'A',
    require: 'ngModel',
    link: function link($scope, $el, attrs, ngModelCntrl) {
      var baseInterval = attrs.validateDateInterval || null;

      ngModelCntrl.$parsers.push(check);
      ngModelCntrl.$formatters.push(check);

      function check(value) {
        if (baseInterval) {
          ngModelCntrl.$setValidity('dateInterval', parseWithBase(value) === true);
        } else {
          ngModelCntrl.$setValidity('dateInterval', (0, _parse_interval.parseInterval)(value) != null);
        }
        return value;
      }

      // When base interval is set, check for least common interval and allow
      // input the value is the same. This means that the input interval is a
      // multiple of the base interval.
      function parseWithBase(value) {
        try {
          var interval = (0, _least_common_interval.leastCommonInterval)(baseInterval, value);
          return interval === value.replace(/\s/g, '');
        } catch (e) {
          return false;
        }
      }
    }
  };
